This interface allows a component to enable or disable acknowledgments
on a per-packet basis.

@author Jonathan Hui
@author Philip Levis
@author Joe Polastre
@date   June 21 2006

Tell a protocol that when it sends this packet, it should not use
synchronous acknowledgments.

@param 'message_t* ONE msg' - A message which should not be acknowledged when transmitted.
@return SUCCESS if acknowledgements are disabled, EBUSY
if the communication layer cannot disable them at this time, FAIL
if it cannot support unacknowledged communication.

The Active Message accessors, which provide the AM local address and
functionality for querying packets. Active Messages are a single-hop
communication protocol. Therefore, fields such as source and destination
represent the single-hop source and destination. Multihop sources and
destinations are defined by the corresponding multihop protocol (if any).
Also see the Packet interface.

@author Philip Levis 
@date   January 18 2005
@see    Packet
@see    AMSend
@see    TEP 116: Packet Protocols

